		{
			this.scroller.text = "The purpose of an astrocyte is to monitor and control the extracellular space.\n\nFor example, astrocytes can regulate ion concentrations within the extracellular fluid, such as sodium (the main cation) and chloride(the main anion).";
		}
		
		this.btnAstrocyte1.addEventListener("click", fl_MouseClickHandler_2.bind(this));
		
